import React, { Component } from "react";

export default class Login extends Component {
    render () {
        return (
            <div>
                <div>
                    <img src= {`icons/Logo-Dime-Hor 1.svg`} alt= "Dime logo"/>
                </div>
                <div>
                    <p>Why Dime</p>
                    <p>Products</p>
                    <p>Courses</p>
                    <p>Company</p>
                </div>
            </div>
        )
    }
}
